App.containerView = Ember.View.extend({

	didInsertElement: function() {
		var view = this;
		$(window).bind("scroll", function() {
			view.didScroll();
		});
	},

	didScroll: function() {
		// if(this.isScrolledToBottom()) {
			// var height = $(window).height();
			// var height = $(this.get('element')).height() - 925;
			var height = $(document).height();
			var toTop = $(window).scrollTop();
			var windowHeight = $(window).height();
			var pos = height - windowHeight;
			// console.log(height + ' ' + toTop + ' ' + pos);
			if( toTop > pos - 10 && toTop < pos + 10 ){
				if(App.get('nextRoute')){
					this.get('controller').send('more');
				}
			}
		// }
	},

	template: Ember.Handlebars.compile('<div class="sixteen columns section"><h2>Hi, my name is Jordy Kirkman</h3><p>I like to build stuff.</p></div>')
});

App.Hero = DS.Model.extend({
	localized_name: DS.attr('string'),
});
App.Match = DS.Model.extend({
	players: DS.hasMany('player')
});
App.Player = DS.Model.extend({
	localized_name: DS.attr('string'),
	hero_id: DS.hasMany('player')
});

